import Foundation


func checkValidString(_ value: String) {
#if _DEBUG
    let blockList = ["centre", "organisations", "organisation", "favourite", "colour", "minimise", "organiser", "authorised", "cancelled", "optimise", "capitalise"]
    
    for blockListWord in blockList {
        assert(!value.lowercased().contains(blockListWord), blockListWord + " is an invalid spelling, please use the American spelling for this word")
    }
#endif
}

// We only ever want this one NSLocalizedStringHelper function
// Previously there had been a function that did not require the comment param and added it in
// This caused issues with strings not being localised so we need to enforce use of the comment param to ensure all strings are localised
func NSLocalizedStringHelper(_ value: String,comment: String) -> String {
    checkValidString(value)
    return NSLocalizedString(value, bundle: Bundle.main, comment:comment)
}

func NSLocalizedStringWithArgsHelper(_ value: String,comment: String, args: CVarArg...) -> String {
    return String(format:  NSLocalizedStringHelper(value, comment: comment), arguments: args)
}

func getAppDisplayName() -> String {
    return "Webex"
}

